    were related to the Party's assessment of each presidential candidate a $1,000
    filing fee.  These filing fees do not correspond to the provision of goods or
    services in-kind to the campaign committees.  2. Schedule D of the previous report
    included debt owed to Perkins Coie and AT&T with closing blalnces of $508.75 and
    $962.52 , however they were omited on the Amended October Monthly Report in error.
    \ The Amended October Monthly Report was amended to reflect the missing debt information.
    3. Schedule D discloses $1,208 in payment  to Chirs Perdue, however, there were
    no payments to this individual reflected in the disbursement schedules. Due to
    a clerical mistake, a payable in the amount of $1,208 owed to Perkins Coie was
    incorrectly listed on Schedule D as owed to Chris Perdue.  The mistake on Schedule
    D was corrected in October 2007 when the outstanding bill was paid to Perkins
    Coie. The report is being amended to reflect the correction."
